import {TextField, makeStyles, Button} from '@material-ui/core'





function Searchbar({onChange}){

    const classes = useStyles()
    return (
        <div className={classes.inline}>
        <TextField
          id="outlined-search"
          label={'Search'}
          value={'hi'}
          variant="standard"
          color='success'
        />
        <Button>Search</Button>
        </div>
    )

}

export default Searchbar
